import React from 'react';
import { Menu } from 'antd';
import { Link } from 'react-router-dom';

export default function MenuReponsive() {
    return (
        <Menu mode="inline" style={{ borderRight: 'none' }}>
            <Menu.Item key={0}>
                <Link to="/about">Account</Link>
            </Menu.Item>
            <Menu.Item key={1}>
                <Link to="/about">Setting</Link>
            </Menu.Item>

            <SubMenu
                key="sub1"
                title={<span>Navigation Three</span>}
            >
                <Menu.Item key="3">Option 3</Menu.Item>
                <Menu.Item key="4">Option 4</Menu.Item>
            </SubMenu>

            <Menu.Divider />
            <Menu.Item key={2}>
                <Link to="/about">Logout</Link>
            </Menu.Item>
        </Menu>
    );
}
